metadata.content:
OpenAI Model
Configuration
The
```
openai
```
function accepts a model name string or a configuration object:
Copy Ask AI
```
const agent = createAgent ({
model: openai ({
model: "gpt-4" ,
apiKey: process . env . OPENAI_API_KEY ,
baseUrl: "https://api.openai.com/v1/" ,
defaultParameters: { temperature: 0.5 },
}),
});
```
